import React from 'react';

function ResultArticles(props) {
    let articles = [];
    props.articles.forEach(article => {
        articles.push(
            <li key = {article._id } className="list-group-item">
                <h4>
                    <span>
                        <em>{article.headline.main}</em>
                    </span>
                    <span className="btn-group pull-right">
                        <a  href={article.web_url} target="_blank">
                            <button className="btn btn-default ">Visit IT</button>
                        </a>
                        <button className="btn btn-primary" onClick={() => props.handleSaveButton(article._id)}>Save IT</button>
                    </span>
                </h4>
                <p>Published at: {article.pub_date}</p>
            </li>
        )
    });
    return (
        <div>
            {articles}
        </div>    
    )
}
export default ResultArticles;
